import React, { useState } from 'react';

function App() {
    const [phoneNumber, setPhoneNumber] = useState('');

    const handleKeyPress = (key) => {
        setPhoneNumber(prev => prev + key);
    }

    const handleClear = () => {
        setPhoneNumber('');
    }

    const handleDelete = () => {
        setPhoneNumber(prev => prev.slice(0, -1));
    }

    return (
        <div className="min-h-screen bg-gray-100 flex flex-col justify-center items-center">
            <div className="mb-8 text-2xl font-semibold">Your phone number is your claim ticket</div>
            <div className="mb-8 bg-white p-4 rounded w-64">
                <input
                    type="tel"
                    readOnly
                    className="w-full p-2 border-b mb-4 text-center"
                    value={phoneNumber}
                />
                <div className="grid grid-cols-3 gap-4">
                    {['1', '2', '3', '4', '5', '6', '7', '8', '9', 'Clear', '0', 'X'].map(key => (
                        <button
                            key={key}
                            className="w-full h-10 bg-gray-200 rounded hover:bg-gray-300"
                            onClick={() => {
                                if (key === 'Clear') handleClear();
                                else if (key === 'X') handleDelete();
                                else handleKeyPress(key);
                            }}
                        >
                            {key}
                        </button>
                    ))}
                </div>
            </div>
            <button className="bg-blue-500 text-white p-2 rounded hover:bg-blue-600">Confirm</button>
            <div className="mt-4 text-sm text-gray-600">
                By confirming, you agree to Privacy Policy &amp; Terms &amp; Conditions.
            </div>
        </div>
    );
}

export default App;
